import React from "react";
import "./AboutUs"

function AboutUs() {
  return (
    <>
      <p>
      Welcome to our website, we are a family owned business! Adventure Room was established in 2022, with the intent to create a new kind of fun for our dear customers!
      </p>
    </>
  );
}

export default AboutUs;
